import { useEffect } from "react";
import "./App.css";
import axios from "axios";
const API_URL = "http://localhost:8080/";

const App = () => {
  const getItemsByCode = (code) => {
    axios.get(`${API_URL}item?code=${code}`).then((res) => {
      console.log(res);
    });
  };

  useEffect(() => {
    getItemsByCode("1");
  });

  return (
    <div className="app">
      <h1>corkboard</h1>
      <div className="search">
        <input placeholder="code..."></input>
      </div>
      <div>
        <button>Use Code!</button>
        <button>New Code!</button>
      </div>
    </div>
  );
};

export default App;
